import {TextField} from '@material-ui/core'

const CreatePost = ()=>{
    return(
        <div className="card input-field">
        <TextField fullWidth placeholder="title"
        />
        <TextField fullWidth placeholder="body"
        />
        </div>
    )
}

export default CreatePost;
